    public static int[] numSmallerByFrequency(String[] queries, String[] words) {
        int[] temp = new int[12];
        int len = 0;
        for (String word : words) {
            len = findSmallestLen(word);
            temp[len]++;
        }
        for (int i = temp.length - 2; i >= 0; i--) {
            temp[i] += temp[i + 1];
        }
        System.out.println(Arrays.toString(temp));

        int index = 0;
        int[] result = new int[queries.length];
        for (String query : queries) {
            len = findSmallestLen(query);
//            val = 0;
//            for (int i = len + 1; i < temp.length; i++) {
//                val += temp[i];
//            }
//            result[index++] = val;
            result[index++] = temp[len + 1];
            /**
             * 减少temp的循环
             */
        }
        return result;
    }

    private static int findSmallestLen(String word) {
        char[] temp = word.toCharArray();
        char min = '|';
        int val = 0;
        for (char c : temp) {
            if(c == min){
                val++;
            }else if(c < min){
                min = c;
                val = 1;
            }
        }
        return val;
    }
